// SPDX-License-Identifier: MIT
pragma solidity ^0.7.4;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/utils/Address.sol";

import "@chainlink/contracts/src/v0.7/VRFConsumerBase.sol";

import "../library/Governance.sol";
import "../interface/INftAsset.sol";
import "../interface/ICifi_Token.sol";

contract SantaFactory is Governance, VRFConsumerBase, IERC721Receiver {
    using Address for address;
    using SafeMath for uint256;

    struct SantaV1Data {
        uint256 id;
        uint256 class;
        uint256 staking_powa;
        uint256 face_value;
        uint256 createdTime;
    }
    uint256 public _stakingPowaBase = 10000;
    event NFTAdded(uint256 indexed id, address author);

    // for minters
    mapping(address => bool) public _minters;
    mapping(address => bool) public _claimMembers;
    uint256 public _nftId = 0;

    ICifi_Token public _cifi = ICifi_Token(0x0);
    INftAsset public _nft = INftAsset(0x0);

    uint256 public _maxClass = 6;
    uint256 public _maxClassLong = 10;

    // for VRT
    uint256 _maxNftCount = 10000;
    uint256 _linkFee = 0;
    bytes32 _linkKeyHash = bytes32("");
    mapping(bytes32 => address) public requestIdToAddress;
    mapping(bytes32 => uint256) public requestIdToFaceValue;
    mapping(address => uint256) public _lastClaimedNFTId;

    constructor(
        address cifi,
        address nft,
        uint256 maxNftCount,
        address vrfCoordinator,
        address linkToken,
        bytes32 linkKeyHash,
        uint256 linkFee
    ) VRFConsumerBase(vrfCoordinator, linkToken) {
        _cifi = ICifi_Token(cifi);
        _nft = INftAsset(nft);
        _maxNftCount = maxNftCount;
        _linkFee = linkFee;
        _linkKeyHash = linkKeyHash;
    }

    /**
     * @dev for set min burn time
     */

    function addMinter(address minter) public onlyGovernance {
        _minters[minter] = true;
    }

    function removeMinter(address minter) public onlyGovernance {
        _minters[minter] = false;
    }

    /**
     * @dev set cifi contract address
     */
    function setCifiContract(address cifi) public onlyGovernance {
        _cifi = ICifi_Token(cifi);
    }

    function setNftContract(address nft) public onlyGovernance {
        _nft = INftAsset(nft);
    }

    function balance() public view returns (uint256) {
        return _nft.balanceOf(msg.sender);
    }

    function tokens() public view returns (uint256[] memory) {
        return _nft.tokensOfOwner(msg.sender);
    }

    function mint(uint256 staking_powa, uint256 face_value)
        public
        returns (uint256)
    {
        _nftId++;
        _nft.mint(msg.sender, _nftId);
        emit NFTAdded(_nftId, msg.sender);
        return _nftId;
    }

    function nextTokenID() public view returns (uint256) {
        return _nftId + 1;
    }

    function distribute(address to, uint256 nftID) public returns (uint256) {
        require(_minters[msg.sender], "can't mint");
        _nftId = nftID;
        _nft.mint(to, nftID);
        emit NFTAdded(nftID, to);
        return nftID;
    }

    function hasClaim() public view returns (bool) {
        return _claimMembers[msg.sender];
    }

    function claim() public returns (bytes32) {
        require(_claimMembers[msg.sender] == false, "has claim");

        _claimMembers[msg.sender] = true;
        require(
            LINK.balanceOf(address(this)) >= _linkFee,
            "Not enough LINK - fill contract with faucet"
        );

        bytes32 requestId = requestRandomness(_linkKeyHash, _linkFee);
        requestIdToAddress[requestId] = msg.sender;

        // _nftId++;

        // _nft.mint(msg.sender, _nftId);
        // emit NFTAdded(_nftId, msg.sender);
        // _nftId = (requestId % _maxNftCount) + 1;
        return requestId;
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness)
        internal
        override
    {
        address requestAddress = requestIdToAddress[requestId];
        uint256 nftID = (randomness % _maxNftCount) + 1;

        while (_nft.exists(nftID)) {
            nftID = ((nftID + 1) % _maxNftCount) + 1;
        }

        _nftId = nftID;

        _nft.mint(requestAddress, _nftId);
        _lastClaimedNFTId[requestAddress] = _nftId;
        onmint(_nftId, requestAddress);
        // emit NFTAdded(_nftId, requestAddress);
    }

    function getLastClaimedNFTId()
    public view returns (uint256)
    {
        return _lastClaimedNFTId[msg.sender];
    }

    function onmint(uint256 nftId, address reqAddress)
    public returns (uint256)
    {
        emit NFTAdded(nftId, reqAddress);
        return 1;
    }
    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}
